def validate_patient_data(data):
    """
    發送 Patient resource 至 FHIR server (NDMC or HAPI) 驗證格式是否正確

    Parameters:
    - data: Patient resource 的資料

    Returns:
    - None: 印出發送結果
    """

    # NDMC FHIR server 的 URL
    # sApiUrl = "http://fhirserver.ndmctsgh.edu.tw:18080/fhir/Patient" 

    # HAPI FHIR server 的 URL
    sApiUrl = "http://172.18.0.53:10004//fhir/Patient"

    # 轉換成 JSON
    data_json = json.dumps(data)
    
    # 取得 token
    sJWT = get_token()

    # 設定 HTTP 請求的標頭
    headers = {
        "Content-Type": "application/fhir+json",  
        "Authorization": f"Bearer {sJWT}"  
    }

    try:

        response = requests.post(sApiUrl, data=data_json, headers=headers)

        if response.status_code == 201:
            print("Patient sent successfully")
            formatted_response = json.dumps(response.json(), indent=4, ensure_ascii=False)
            print(formatted_response)

        else:
            print("Failed to send Patient")
            print(response.text)

    except RequestException as e:
        print(f"Request failed: {e}")

    except ValueError as e:
        print(f"Error parsing JSON response: {e}")


